import logo from './logo.svg';
import './App.css';
import Menu from './menu';

function Header() {
  return (
    <h1 className='welcome'>CW.</h1>
  );
}

function App() {
  return (
    <div className="App">
      <div className="header-menu-container">
        <Header />
        <Menu />
      </div>
      <div className='introduction'>
        <h1>I'm Anantha Ramu</h1>
        <h4>frontend developer,Python engineer and Android developer and playing game and listening the music for relax</h4>

      </div>
    </div>
  );
}

export default App;
